import React from 'react';
import MenuItem from './MenuItem';

const Menu = ({ items }) => (
  <div>
    <h2>Menu</h2>
    {items.map((item, index) => (
      <MenuItem key={index} item={item} />
    ))}
  </div>
);

export default Menu;
